import{_ as r,c as t,a,o as l}from"./app.109432a7.js";const b=JSON.parse('{"title":"\uACFC\uAC70\uC758 \uB098\uB97C \uB2E4\uC2DC \uB418\uB3CC\uC544\uBCF4\uAC8C \uB41C \uB0A0","description":"","frontmatter":{"title":"\uACFC\uAC70\uC758 \uB098\uB97C \uB2E4\uC2DC \uB418\uB3CC\uC544\uBCF4\uAC8C \uB41C \uB0A0","createBy":"2022-08-03T00:00:00.000Z"},"headers":[{"level":2,"title":"","slug":"\uC624\uB298\uC758-\uC77C\uC9C0-\u{1F3AA}"},{"level":2,"title":"","slug":"\uC624\uB298-\uD55C\uC77C\uB4E4"}],"relativePath":"sdhs/2208/220803.md"}'),s={name:"sdhs/2208/220803.md"};function i(n,e,o,d,h,c){return l(),t("div",null,e[0]||(e[0]=[a('<h2 id="\uC624\uB298\uC758-\uC77C\uC9C0-\u{1F3AA}" tabindex="-1"><h2 style="font-size:30px;">\uC624\uB298\uC758 \uC77C\uC9C0 \u{1F3AA}</h2> <a class="header-anchor" href="#\uC624\uB298\uC758-\uC77C\uC9C0-\u{1F3AA}" aria-hidden="true">#</a></h2><p>\uB098\uB294 \uC0B4\uB2E4\uAC00 \uBCF4\uBA74 \uAC00\uB054 \uC544\uBB34 \uC0DD\uAC01\uB3C4 \uC54A\uD558\uACE0 \uB0B4\uAC8C \uC8FC\uC5B4\uC9C4 \uC77C\uB9CC \uC544\uBB34 \uC0DD\uAC01\uC5C6\uC774 \uCC98\uB9AC\uD558\uBA74\uC11C \uC0B4\uB54C\uAC00 \uC788\uB2E4. \uC9C0\uAE08\uC758 \uC0DD\uD65C\uC758 \uB9CC\uC871\uD558\uACE0 \uBB58 \uB354 \uD558\uB77C\uAE30\uB3C4 \uAFC8\uC744 \uD5A5\uD574 \uB2EC\uB824\uAC00\uB358 \uACFC\uAC70\uC758 \uAE30\uC5B5\uB4E4\uB3C4 \uC804\uBD80 \uC78A\uC740\uCC44 \uBAA8\uB4E0 \uC77C\uC774 \uB098\uD0DC\uD574\uC9C0\uACE0 \uC544\uBB34 \uC0DD\uAC01\uC5C6\uC774 \uC0B4\uC544\uAC00\uAC8C \uB418\uB294\uAC83 \uAC19\uB2E4. \uC9C0\uAE08\uAE4C\uC9C0\uC758 \uB098\uB294 \uAD49\uC7A5\uD788 \uB098\uD0DC\uD558\uACE0 \uC81C\uBA4B\uB300\uB85C \uC0B4\uC544\uAC00\uACE0 \uC788\uC5C8\uB358\uAC83 \uAC19\uB2E4. \uC774\uB807\uAC8C \uB0B4\uAC00 \uBC88\uC544\uC6C3 \uC0C1\uD0DC\uC77C\uB54C \uB0B4 \uC0B6\uC758 \uC758\uC695\uC744 \uBD81\uB3CB\uC544 \uC8FC\uACE0 \uC0B6\uC758 \uB3D9\uAE30\uBD80\uC5EC\uB97C \uD574\uC8FC\uB294 \uC77C \uAC83\uB4E4\uC774 \uB300\uD45C\uC801\uC73C\uB85C \uB098\uB294 2\uAC00\uC9C0 \uC815\uB3C4 \uC788\uB2E4. <br><br> \uCCAB\uBC88\uC9F8\uB85C\uB294 \uB098\uBCF4\uB2E4 \uB2A5\uB825\uB3C4 \uC6D4\uB4F1\uD788 \uB6F0\uC5B4\uB098\uACE0 \uB300\uB2E8\uD55C \uC0AC\uB78C\uB4E4\uC774 \uB098\uC5D0\uAC8C \uC870\uC5B8 \uAC19\uC740 \uAC78 \uD574\uC8FC\uB294 \uAC83\uB4E4\uC774 \uC788\uACE0 \uB450\uBC88\uC9F8\uB85C\uB294 \uB0B4 \uC717\uC0AC\uB78C\uB4E4\uD55C\uD14C \uC81C\uB300\uB85C \uD55C\uBC88 \uAE4C\uC600\uC744\uB54C\uB2E4. \uB098\uB294 \uC120\uBC30\uB4E4\uC774 \uB0B4 \uCF54\uB4DC\uB97C \uBCF4\uACE0 \uD63C\uC744 \uB0BC\uB54C\uB098 \uB0B4\uAC00 \uC9C0\uAE08 \uD2C0\uB9B0 \uBC29\uD5A5\uC73C\uB85C \uB098\uC544\uAC00\uACE0 \uC788\uC744\uB54C \uBB50\uB77C\uACE0 \uD558\uB294 \uC18C\uB9AC\uC5D0 \uB0B4\uAC00 \uC9C0\uAE08\uAE4C\uC9C0 \uC0B4\uC544\uC654\uB358 \uC0B6\uC758 \uB300\uD574\uC11C \uC0DD\uAC01\uB3C4 \uB9CE\uC774\uD574\uBCF4\uAC8C \uB418\uACE0 \uBA38\uB9AC\uB3C4 \uC5EC\uBC31\uCC98\uB7FC \uAE54\uB054\uD788 \uBE44\uC6CC\uC838\uC11C \uC55E\uC73C\uB85C \uC5B4\uB5BB\uAC8C \uD560 \uAC83\uC778\uC9C0 \uC0DD\uAC01\uD558\uAE30\uB3C4 \uD55C\uB2E4. \uBB3C\uB860 \uD63C\uC774 \uB098\uACE0 \uC788\uC744 \uB2F9\uC2DC\uC5D0\uB294 \uD654\uB3C4 \uB9CE\uC774\uB098\uACE0 \uAE34\uC7A5\uB3C4 \uD558\uACE0 \uC788\uC5B4\uC11C \uB9CE\uC740 \uC0DD\uAC01\uC744 \uD574\uC11C \uAD34\uB86D\uAE34\uD558\uC9C0\uB9CC \uC9C0\uAE08\uCC98\uB7FC \uC9D1\uC5D0 \uC640\uC11C \uC0DD\uAC01\uC744 \uD574\uBCF4\uBA74 \uC624\uB298 \uD63C\uB0B4\uC9C0 \uC54A\uC558\uC73C\uBA74 \uD3C9\uC18C\uCC98\uB7FC \uC0B4\uACE0 \uC788\uC744 \uB098\uC758 \uBAA8\uC2B5\uC744 \uC0DD\uAC01\uD558\uBA74\uC11C \uAC00\uC2B4 \uD55C\uD3B8\uC73C\uB85C\uB294 \uB2E4\uD589\uC774\uB77C\uB294 \uC0DD\uAC01\uB3C4 \uB4E4\uACE0 \uB098\uB97C \uD63C\uB0B4\uAC70\uB098 \uAF3D\uC8FC\uB294 \uC120\uBC30\uB4E4\uC5D0\uAC8C \uACE0\uB9D9\uB2E4\uB294 \uC0DD\uAC01\uB3C4 \uB4E4\uAC8C \uB41C\uB2E4. <br><br> \uC9C0\uAE08 \uC0DD\uAC01\uD574\uBCF4\uBA74 1\uD559\uB144\uB54C \uB514\uC9C0\uD14D\uACE0 \uAE30\uB2A5\uBC18\uC5D0 \uB4E4\uC5B4\uC640\uC11C \uAE30\uB2A5\uB300\uD68C\uB97C \uC900\uBE44\uD558\uBA74\uC11C \uCC98\uC74C\uC73C\uB85C \uBAA9\uD45C\uB85C \uC0BC\uC558\uB358 \uC77C\uC740 \uC9C0\uBC29\uB300\uD68C \uAE08\uBA54\uB2EC\uC774\uC5C8\uB2E4. \uD558\uC9C0\uB9CC \uC9C0\uAE08 \uC774\uBBF8 \uC9C0\uBC29\uB300\uD68C\uC5D0\uC11C \uAE08\uBA54\uB2EC\uC744 \uB543\uACE0 \uC804\uAD6D\uB300\uD68C\uB97C \uC900\uBE44\uD558\uB294 \uC785\uC7A5\uC5D0\uC11C \uD604\uC7AC\uC758 \uBAA9\uD45C\uB294 \uC804\uAD6D\uB300\uD68C \uBA54\uB2EC\uAD8C\uC774\uBA70 \uAD6D\uC81C\uB300\uD68C\uB3C4 \uB098\uAC00\uACE0 \uC2F6\uC740 \uB9C8\uC74C\uB3C4 \uC870\uAE08\uC788\uB2E4. \uC774 \uBAA9\uD45C\uB97C \uC774\uB8E8\uAE30 \uC704\uD574\uC11C\uB294 \uC9C0\uAE08\uAE4C\uC9C0 \uB0B4\uAC00 \uC804\uAD6D\uB300\uD68C\uC5D0 \uC784\uD588\uB358 \uBAA8\uC2B5\uC73C\uB85C\uB294 \uBAA9\uD45C\uB97C \uC774\uB8F0\uC218 \uC5C6\uB2E4. \uC880 \uB354 \uACC4\uD68D\uC801\uC73C\uB85C \uD558\uB8E8\uB97C \uBCF4\uB0B4\uC57C\uD558\uBA74 \uC2DC\uAC04\uB3C4 \uCD5C\uB300\uD55C \uB0AD\uBE44\uD558\uC9C0 \uC54A\uC544\uC57C\uD558\uACE0 \uB300\uD68C\uC900\uBE44 \uAE30\uAC04\uC5D0\uB294 \uC624\uB85C\uC9C0 \uB300\uD68C\uB9CC\uC744 \uBAA9\uD45C\uB85C \uC0B4\uC544\uAC00\uB294\uAC8C \uC911\uC694\uD55C\uAC83 \uAC19\uB2E4. \uC624\uB298\uC774\uB77C\uB3C4 \uC815\uC2E0\uC744 \uCC28\uB838\uC73C\uB2C8 \uB0B4\uC77C\uC758 \uB098\uB294 \uC5B4\uC81C\uC758 \uB098\uBCF4\uB2E4 \uC880 \uB354 \uC131\uC7A5\uD574 \uC788\uC5C8\uC73C\uBA74 \uC88B\uACA0\uB2E4. <br><br><br><br> \uC774\uB7F0\uAE00\uC740 \uB0B4\uAC00 \uD3C9\uC18C\uC5D0 \uCC45\uC744 \uB354 \uB9CE\uC774 \uC77D\uC5C8\uC73C\uBA74 \uC880 \uB354 \uC9E7\uACE0 \uAC04\uACA9\uD558\uACE0 \uC784\uD329\uD2B8 \uC788\uAC8C \uC4F8 \uC218 \uC788\uC744 \uAC83 \uAC19\uC740\uB370 \uB098\uB294 \uCC45\uC744 \uBCC4\uB85C \uC548 \uC77D\uC5B4\uC11C \uC5B4\uD718\uB2A5\uB825\uC774 \uD655\uC2E4\uD788 \uB538\uB9AC\uB294 \uAC83 \uAC19\uB2E4. \uC774\uB807\uAC8C \uD558\uB8E8\uAC00 \uB05D\uB098\uACE0 \uC77C\uC9C0 \uD615\uC2DD\uC73C\uB85C TIL\uC744 \uC4F0\uB294\uAC8C \uCC98\uC74C\uC5D0\uB294 \uAE43\uD5C8\uBE0C\uC5D0 \uCEE4\uBC0B \uBAA9\uC801\uC73C\uB85C \uC784\uD588\uB294\uB370 \uC774\uB7F0 \uC2DD\uC73C\uB85C \uD558\uB8E8\uB97C \uB2E4\uC2DC \uB418\uB3CC\uC544\uBCF4\uACE0 \uC55E\uC73C\uB85C\uC758 \uACC4\uD68D\uC5D0 \uB300\uD574 \uC815\uB9AC\uD558\uB294 \uACC4\uAE30\uAC00 \uB418\uB294\uAC8C \uB09C \uC88B\uC740\uAC83 \uAC19\uB2E4. \uC774\uB7F0\uC2DD\uC73C\uB85C \uB0B4\uAC00 \uB0B4 \uB9C8\uC74C\uC744 \uC194\uC9C1\uD558\uAC8C \uD138\uC5B4\uB193\uACE0 \uAE00\uC744 \uC4F0\uB294\uAC83 \uCC28\uCCB4\uB3C4 \uB418\uAC8C \uC88B\uC740 \uAC83 \uAC19\uACE0... \u314E\u314E <br> \uB0B4\uAC00 \uC624\uB298 \uC774\uB7F0 \uAE00\uC744 \uC4F0\uAC8C \uB41C \uC774\uC720\uB294 \uAE30\uB2A5\uBC18\uC5D0\uC11C \uACC4\uD68D\uD588\uB358 \uC77C\uB4E4\uC744 \uC81C\uB300\uB85C \uC218\uD589\uD558\uC9C0 \uC54A\uACE0 \uB098 \uD63C\uC790 \uB2E4\uB978 \uAC83\uB4E4\uC744 \uD558\uACE0 \uC788\uC5B4\uC11C \uBBFC\uC11D\uC774\uD615\uD55C\uD14C \uC624\uB298 \uAF3D \uC880 \uBA39\uC5C8\uB2E4. \uAF3D \uBA39\uC740 \uB4A4\uB85C \uC11C\uC6B8 A\uBAA8\uB4C8 \uC880 \uD480\uB2E4\uAC00 \uC9D1\uC73C\uB85C \uADC0\uAC00 \uD588\uB294\uB370 \uB0B4\uC77C\uC740 \uC801\uC5B4\uB3C4 \uC11C\uC6B8 A, B\uB97C \uC644\uC131\uC2DC\uD0A4\uACE0 C\uB97C \uB4E4\uC5B4\uAC00\uB294\uAC8C \uBAA9\uD45C\uB2E4. \uBE44\uB85D \uC2EC\uD558\uAC8C \uAF3D \uBA39\uC740\uAC74 \uC544\uB2C8\uC9C0\uB9CC \uC624\uB298 \uAF3D\uBA39\uC740\uAC74 \uACFC\uAC70\uC758 \uB098\uB97C \uB418\uB3CC\uC544\uBCF4\uAC8C \uB9CC\uB4DC\uB294 \uC88B\uC740 \uACC4\uAE30\uC600\uB358\uAC83 \uAC19\uB2E4. <br><br></p><h2 id="\uC624\uB298-\uD55C\uC77C\uB4E4" tabindex="-1"><h2 style="color:#ee4867;font-size:30px;">\uC624\uB298 \uD55C\uC77C\uB4E4</h2> <a class="header-anchor" href="#\uC624\uB298-\uD55C\uC77C\uB4E4" aria-hidden="true">#</a></h2><hr><ul><li>\uC804\uB0A8 C\uBAA8\uB4C8 \uC7AC\uC810\uD6C4 \uD2C0\uB9B0 \uAE30\uB2A5 \uACE0\uCE58\uAE30 <ul><li>\uC911\uAC04\uC5D0 \uBAA8\uB2EC\uCC3D\uC5D0\uC11C \uB0A0\uC9DC \uC120\uD0DD\uD560\uB54C \uC774\uBBF8 \uD574\uB2F9 \uB0A0\uC9DC\uC5D0 \uBC84\uC2A4\uD0B9\uC774 \uC608\uC57D\uB418\uC5B4 \uC788\uC73C\uBA74 \uC548\uBCF4\uC774\uAC8C \uD574\uC57C\uD558\uB294\uB370 \uAE4C\uBA39\uACE0 \uC548\uD574\uC11C \uADF8 \uBD80\uBD84 \uBCF4\uC548</li></ul></li><li>\uC11C\uC6B8 A\uBAA8\uB4C8 \uD480\uAE30(50% \uC815\uB3C4 \uC9C4\uD589\uC911)</li></ul>',5)]))}var u=r(s,[["render",i]]);export{b as __pageData,u as default};
